content:
Something very cool that came up. As you all know, I've been a Zep-head since my preteen years.

Local band that tours nationally needed a fill-in vocalist for a show at the Mill Street Tavern in Ardmore, OK and asked - I gladly accepted the honor.

&nbsp;

We're hitting the road to Iowa for a road gig on the Dookie revisited tour
Not sure who the opener will be or if it'll be just us, either way we're looking forward to rocking some old stomping grounds!
&nbsp;

Playing Wichita Falls again at this kick-ass venue!
