Our first time at Sundown Grenada next to the Grenada Theater in Dallas, TX. Green Dazed is a tribute to Green Day, we perform their music and bring it to life in our own glorious fashion. You can find us on Facebook at @greendazed.
Sundown Grenada is a restaurant and bar with live music: http://sundownatgranada.com/
&nbsp;

Join me for a Wednesday night at Oakmont Country Club in Denton / Corinth.
I'll be providing live solo acoustic entertainment for a couple of hours while Audacity Brewery out of Denton, TX will be providing a beer tasting. There will be other food and festivities as well.
